    fetch('http://localhost:3000/users')
    .then(resp => resp.json())
    .then(users => this.setState({users}))
}

render (){
    return (
        <div>
            <h1>LifeTour</h1>
            <p>welcome to your journey!</p>
            <User />
        </div>
    )
}
}

export default Home;
